import React from 'react';    

class ModalDialogPopUp extends React.Component {  
  render() {  
    return (  
        <div id="modal_dialog_container">
            <div id = "modal_yes_no_dialog_background"></div>
            <div id="modal_yes_no_dialog" >
                <p><b>&nbsp;&nbsp;Delete List? <br></br> <br></br>
                &nbsp;&nbsp;Are you sure you want to delete this list?</b>
                <br></br><br></br><br></br> &nbsp;&nbsp;&nbsp;
                <button id="list_confirm_delete" onClick={this.props.confirmDeleteList.bind(this, this.props.todoList.key)}> Yes </button>&nbsp;&nbsp;&nbsp;&nbsp; 
                <button id="list_cancel_delete" onClick={this.props.hideModalDialogPopUp}> No </button>     
                <br></br><br></br><br></br><br></br>        
                &nbsp;&nbsp;<b>The list will not be retrievable.</b></p>
            </div>
        </div>
    );  
    }  
}  
export default ModalDialogPopUp;
